script: |
  super -f text -I q12789.spq | sort > q12789.out

inputs:
  - name: q12789.spq
    data: |
      SELECT ALL + col1 / - CAST ( - col0 AS REAL ) + + 17 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE - + col1 >= ( - + 17 * - 12 + col1 ) AND NULL IN ( + col2 );
  - name: tab2

outputs:
  - name: q12789.out
    data: |
